function twoletters(){var a="";var c="ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz";for(var b=0;b<2;b++){a+=c.charAt(Math.floor(Math.random()*c.length))}return a}function shuffle(e){var d=[];var c=e.length,b,a;while(0!==c){a=Math.floor(Math.random()*c);c-=1;b=e[c];e[c]=e[a];d[c]=e[a];e[a]=b}return d}function get_unid(){unid=twoletters()+twoletters()+randomdigit(0,9)+randomdigit(0,9)+randomdigit(0,9)+randomdigit(0,9)+randomdigit(0,9)+randomdigit(0,9)}function randomdigit(b,a){return Math.floor(Math.random()*(a-b+1))+b};